/** @format */

import React from "react";
import styled from "styled-components";
import MenuCard from "./MenuCard";
const MenuBlock = styled.div`
  width: 100%;
  margin-bottom: 5vh;
`;

const Category = styled.div`
  padding: 1.5rem 0;
  font-size: 1rem;
`;

const MenuBox = () => {
  return (
    <MenuBlock>
      <Category>추천메뉴</Category>
      <MenuCard />
    </MenuBlock>
  );
};

export default MenuBox;
